import React from 'react';
import { slide as Menu } from 'react-burger-menu'

class Nav extends React.Component {
  showSettings (event) {
    event.preventDefault();
  }

  render () {
    return (
      <Menu 
      right 
      pageWrapId={ "page-wrap" } 
      outerContainerId={ "outer-container" } 
      isOpen={this.state.menuOpen}
      onStateChange={(state) => this.handleStateChange(state)}
      >
        <a id="aboutNav" className="menu-item" href="#About">About Me</a>
        <a id="experiencesNav" className="menu-item" href="#Experiences">Experiences</a>
        <a id="skillsNav" className="menu-item" href="#Skills">Skills</a>
        <a id="contactNav" className="menu-item" href="#Contact">Contact</a>
      </Menu>
    );
  }
}

export default Nav;
